import React from 'react';


function Home() {
  return (

        <div className="App">
          <Header />
          <div className="main-layout">
            <Sidebar />
            <main className="content">
            <div>
              <h1>Bienvenido a Nuestra Aplicación</h1>
              <p>Esta es la página principal.</p>
            </div>
            </main>
          </div>
          <Footer />
        </div>
  );
}

export default Home;
